// VinosList.js
import React from 'react';

const VinosList = ({ vinos }) => {
  return (
    <div>
      <h2>Lista de Vinos</h2>
      <ul>
        {vinos.map((vino) => (
          <li key={vino._id}>
            <h3>{vino.nombre}</h3>
            <p>Tipo: {vino.tipo}</p>
            <p>ID Bodega: {vino.bodega}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default VinosList;
